import React, { useEffect, useState } from "react";
import { useForm } from 'react-hook-form';
import axios from "axios";
import { Button, FloatingLabel, Modal, Form } from "react-bootstrap";

interface Sprofile {
  id: number
  email: string
  mobile: string
}

interface Sstandard {
  id: number
  standardName: string
}

interface Sparent {
  id: number
  parentName: string
}

interface FormData {
    id: number
    studentName: string
    profile : Sprofile
    parents:Sparent[] 
    standards : Sstandard[]
  }

  const Studentlist = () =>{
    const [notesList, setnotesList] = useState<Array<FormData>>([]);
    const { register, handleSubmit, reset } = useForm<FormData>();

   useEffect(() => {
      getStudent();
      }, []);
    const getStudent= async () => {
        try{
            const response = await axios.get('http://localhost:5000/students')
            const gotdata =  response.data;
            console.log(gotdata);
            setnotesList(gotdata);
          }catch(err){
            console.error(err);
          }
        };
    return (
      <div>
        <div className="container-fluid"><br></br><br></br>
          <div className="row">
            <div className="col-md-12">
            <h3>STUDENTS</h3><br></br><br></br>
              <form>
                <table>

                    {notesList.map((noteitem, index) => {
                    return (
                        <tr>
                        <td>{noteitem.studentName}</td> 
                        <td>{noteitem.profile.email}</td> 
                        <td>{noteitem.profile.mobile}</td> 
                        <td>{noteitem.parents[0].parentName}</td> 
                        <td>{noteitem.parents[1].parentName}</td> 
                        <td>{noteitem.standards[0].standardName}</td>
                        </tr>
                        )}
                    )}
                </table>
              </form>
            </div>
          </div>
        </div>
      </div>
    );
    }

    export default Studentlist;
